import React from "react";
import {BoxPicture} from "../styles/components/BoxPicture/BoxPicture.styled";

type PicturePropsType = {
	pathImages: string
}

function Picture(props: PicturePropsType) {
	return (
		<BoxPicture>
			<img src="../images/bg.jpg" alt={'picture'}/>
		</BoxPicture>
	)
}

export default Picture;
